css:
@-moz-document url-prefix("chrome://global/content/netError.xhtml") {
  /* Error page styles */
  body {
    background-color: #f5f5f5;
  }
  h1 {
    color: #333;
    font-size: 24px;
    margin-top: 40px;
  }
  p {
    color: #666;
    font-size: 18px;
  }
  /* Customize the error message */
  h1:before {
    content: "Oops! ";
  }
  p:before {
    content: "The requested URL could not be retrieved.";
  }
}
